import hexagon_star from "../videos/hexagon-star.mp4";
import xt_square from "../videos/xt-square.mp4";
import bouncy_rose from "../videos/bouncy-rose.mp4";
import pentaspiral from "../videos/pentaspiral.mp4";

export default {
  kochpinski,
  snowflake,
